import './App.css';
import {  BrowserRouter, Routes,Route} from 'react-router-dom'
import Home from './component/home';
import Login from './component/login';


function App(){

    return (
      <BrowserRouter>
      <Routes>
        <Route path='/' element={<Login/>}/>
      </Routes>
      </BrowserRouter>
    );


}

export default App;
